import './Contact.css'

function Contact() {
  return (
    <div className='contact-body'>

      <a href="https://mail.google.com/mail/?view=cm&fs=1&to=sukrit37@gmail.com" className='contact-links'>Email↗</a>
      <a href="https://www.linkedin.com/in/sukrit37/" className='contact-links'>Linkedin↗</a> 
      <a href="https://github.com/Sukrit3007" className='contact-links'>Github↗</a>
      <a href="https://github.com/Sukrit3007" className='contact-links'>Github↗</a>

    </div>
  )
}

export default Contact
